import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import TrainingLogRow from "./TrainingLogRow";

// --- API Manager ---
const BASE_URL = "http://localhost:8000/api/tables";

export class TrainingLogManager {
    async loadTable(id) {
        const res = await fetch(`${BASE_URL}/${encodeURIComponent(id)}`);
        if (!res.ok) return null;
        return await res.json();
    }

    async saveTable(log) {
        const res = await fetch(BASE_URL, {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(log),
        });
        if (!res.ok) throw new Error("Save failed");
        return await res.json();
    }

    async deleteTable(id) {
        const res = await fetch(`${BASE_URL}/${encodeURIComponent(id)}`, {
            method: "DELETE",
        });
        if (!res.ok) throw new Error("Delete failed");
        return true;
    }

    async listTables() {
        const res = await fetch(BASE_URL);
        if (!res.ok) return [];
        return await res.json();
    }
}

const manager = new TrainingLogManager();

export default function TrainingLogTable() {
    const { id } = useParams(); // unique log ID from route
    const [log, setLog] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const loadLog = async () => {
            let loaded = await manager.loadTable(id);
            if (!loaded) {
                const today = new Date().toISOString().split("T")[0];
                const defaultRow = {
                    id: 0,
                    muscleGroup: "Strength-FocusðŸ‹ï¸",
                    exercise: "",
                    sets: [
                        { reps: "", weight: "" },
                        { reps: "", weight: "" }
                    ],
                    notes: "No notes ðŸ˜Š",
                    showNotes: false,
                    weightUnit: "lbs"
                };
                loaded = {
                    id: id,
                    tableName: `New Table - ${today}`,
                    date: today,
                    rows: [defaultRow]
                };
            }
            setLog(loaded);
        };
        loadLog();
    }, [id]);

    const updateRow = (index, updatedRow) => {
        const newRows = [...log.rows];
        newRows[index] = { ...newRows[index], ...updatedRow };
        setLog({ ...log, rows: newRows });
    };

    const addRow = () => {
        const newRow = {
            id: log.rows.length,
            muscleGroup: "Strength-FocusðŸ‹ï¸",
            exercise: "",
            sets: [{ reps: "", weight: "" }],
            notes: "No notes ðŸ˜Š",
            showNotes: false,
            weightUnit: "lbs"
        };
        setLog({ ...log, rows: [...log.rows, newRow] });
    };

    const deleteLastRow = () => {
        if (log.rows.length <= 1) return;
        const newRows = log.rows.slice(0, -1);
        setLog({ ...log, rows: newRows });
    };

    const handleSave = async () => {
        try {
            await manager.saveTable(log);
            alert("Saved successfully.");
        } catch (e) {
            setError("Failed to save changes");
        }
    };

    if (!log) return <div>Loading...</div>;

    return (
        <div style={{ padding: "2rem", color: "#f5f6fa", background: "#000", minHeight: "100vh" }}>
            <input
                type="text"
                value={log.tableName}
                onChange={(e) => setLog({ ...log, tableName: e.target.value })}
                style={{
                    fontSize: "1.5rem",
                    fontWeight: "bold",
                    background: "transparent",
                    border: "none",
                    borderBottom: "1px solid #666",
                    color: "#ffd966",
                    marginBottom: "1rem",
                    width: "100%"
                }}
            />
            <input
                type="date"
                value={log.date}
                onChange={(e) => setLog({ ...log, date: e.target.value })}
            />
            <hr />

            {log.rows.map((row, index) => (
                <TrainingLogRow
                    key={row.id}
                    rowData={row}
                    onUpdate={(updated) => updateRow(index, updated)}
                />
            ))}

            <button onClick={addRow}>+ Add Exercise</button>
            <button onClick={deleteLastRow} disabled={log.rows.length <= 1}>
                - Delete Last
            </button>
            <button onClick={handleSave} style={{ marginLeft: "1rem" }}>
                ðŸ’¾ Save Log
            </button>
            {error && (
                <div style={{ color: "#ff6b6b", marginTop: "1rem" }}>
                    {error}
                </div>
            )}
        </div>
    );
}
